import { jsPDF } from "jspdf"
export default function customFontTiro(){
var font = '';
var callAddFont = function () {
this.addFileToVFS('TiroDevanagariHindi-Regular-normal.ttf', font);
this.addFont('TiroDevanagariHindi-Regular-normal.ttf', 'TiroDevanagariHindi-Regular', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
}